.user-money-details-container {
  width: 100%;
  height: 100%;
  padding-bottom: 20px;
  background-color: #fff;
  overflow-y: auto;
  scroll-behavior: smooth;
  .item-list {
    padding: 20px;
    &.hairline-border::after {
      border-width: 0 !important;
      border-bottom-width: 1px !important;
    }
  }
  .item-title-amount {
    font-size: 28px;
