      color: #ffc400;
    }
    .pay-out {
      color: #13161b;
    }
  }
  .item-datetime-balance {
    margin: 20px 0;
    font-size: 25px;
    color: #868d9a;
  }
  .item-remark {
    font-size: 21px;
    color: #868d9a;
    text-align: justify;
  }
}

